INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (703, 'Contrat d''avenir', 'Créé par la loi 2005-31 du 18 janvier 2005, le contrat d''avenir est destiné aux titulaires du RMI, de l''ASS ou de l''API et doit prévoir des actions de formation. Il sera remplacé au 1er janvier 2010 par le contrat unique d''insertion (loi RSA 2008-1149 du 1er décembre 2008).', 1913, null, '[]', '');
