INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (20, 'Accès aux origines', 'La loi 2001-93 du 11 janvier 2001 relative à l''accès aux origines des personnes adoptées et pupilles de l''État vise à limiter les cas dans lesquels un enfant peut être privé des informations concernant son identité et ses origines et tend également à favoriser les retrouvailles entre l''enfant et ses parents biologiques en créant le Conseil national pour l''accès aux origines personnelles (CNAOP).', 2748, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (48, 'Accueil de jour médicalisé', 'Constitue une déclinaison de l''accueil de jour qui consiste à accueillir pour une ou plusieurs journées par semaine, voire une demi-journée des personnes âgées vivant à leur domicile, dans des locaux dédiés à cet accueil. Ce type d''accueil s''adresse essentiellement à des personnes atteintes de maladie d''Alzheimer ou de troubles apparentés. Ils peuvent être autonomes ou rattachés à une structure telle qu''un EHPAD. Il s''agit d''un ESMS tel défini à l''article L311-1.I.6e du code de l''action sociale et des familles.', 1505, null, '[]', '');
