INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (103, 'Aide à la création d''entreprise', 'Mesure d''aide à la création d''entreprise au bénéfice des demandeurs d''emploi, des bénéficiaires de minima sociaux, des jeunes de moins de 16 ans, des créateurs d''entreprise en ZUS.', 111, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (115, 'Aide médicale de l''Etat', 'Dispositif spécifique conçu pour prendre en charge les frais de soins des personnes de nationalité étrangère, résidant en France sans titre de séjour régulier, depuis la disparition de l''aide médicale départementale à la suite de la création de la CMU.', 113, null, '[]', 'AME');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (154, 'Allocation journalière de présence parentale', 'L''allocation journalière de présence parentale (AJPP) est attribuée à toute personne qui interrompt ponctuellement son contrat de travail ou bénéficie d''un congé de présence parentale pour assumer la charge d''un enfant âgé de moins de 10 ans atteint d''une maladie, d''un handicap ou victime d''un accident d''une particulière gravité.', 2377, null, '[]', 'AJPP');
