INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (251, 'Assistant de vie aux familles', 'Créé par l''arrêté du 11 juillet 2003 relatif au titre professionnel d''assistant de vie, l''assistant de vie aux familles apporte une aide professionnalisée à domicile auprès de familles, de personnes dites fragilisées ou sensibles comme les jeunes enfants, les personnes âgées ou handicapées.', 2973, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (289, 'Auto-entreprise', 'Nouveau régime instauré par la loi 2008-776 du 4 août 2008 qui s''adresse en particulier aux personnes qui ne veulent pas nécessairement créer une société commerciale pour exercer leur nouvelle activité et souhaitent pouvoir débuter ou arrêter facilement leur activité indépendante.', 2805, null, '[]', 'Auto-entrepreneur');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (306, 'Auxiliaire de vie sociale', 'Les auxiliaires de vie deviennent des auxiliaires de vie sociale, diplômés (décret 2001-410)', 2973, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (324, 'Bail emphytéotique', 'Le bail emphytéotique est un bail immobilier de très longue durée, qui confère au preneur un droit réel sur la chose donnée à bail, à charge pour lui d''améliorer le fonds et de payer un loyer modique, les améliorations bénéficiant au bailleur en fin de bail sans que ce dernier ait à indemniser l''emphytéote.', 323, null, '[]', '');
