INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (445, 'Capital-décès', 'Le capital-décès est une indemnité. Elle permet aux proches de l''assuré de faire face aux frais immédiats entraînés par son décès (notamment les frais d''obsèques).', 265, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (473, 'Cellule de crise', '', 2747, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (476, 'Centre antipoison', 'Les centres antipoison (CAP) et de toxicovigilance sont des centres d''information sur les risques toxiques de tous les produits médicamenteux, industriels et naturels. Ils ont un rôle d''information auprès des professionnels de santé et du ', 1212, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (484, 'Centre de lutte contre le cancer', 'Remplace les centres anti-cancéreux à partir de 1964. Les centres régionaux de lutte contre le cancer (CRLCC), érigés le 1er octobre 1945 par une ordonnance du Général de Gaulle (art. L.311 & s. du Code de la santé publique). Les centres de lutte contre le cancer sont des établissements entièrement consacrés au dépistage, au diagnostic et aux traitements des cancers.', 1212, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (534, 'Chèque transport', 'Créé par la loi 2006-1770, c''est un titre de paiement préfinancé par l''employeur pour le paiement des dépenses liées au déplacement des salariés entre leur résidence et leur lieu de travail.', 1987, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (562, 'Classe d''Intégration Scolaire (CLIS)', 'Les CLIS ont été créées pour organiser la scolarité des élèves qui ne peuvent, dans l''immédiat, être accueillis dans une classe ordinaire et pour lesquels l''admission dans un établissement spécialisé ne s''impose pas.', 1625, null, '[]', 'CLIS');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (588, 'Collège interentreprises de sécurité, de santé et des conditions de travail (CISSCT)', '', 2570, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (598, 'Comité d''hygiène, de sécurité et des conditions de travail (CHSCT)', '', 1615, null, '[]', 'Comité d''hygiène de sécurité et des conditions de travail');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (612, 'Commission des droits et de l''autonomie des personnes handicapées ', 'Cette commission prend les décisions relatives à l''ensemble des droits d''une personne handicapée notamment en matière d''attribution de prestations et d''orientation (Loi 2005-101 du 11 février 2005. Elle remplace la Commission départementale de l''éducation spéciale (CDES), la COTOREP et le Site pour la vie autonome.', 1829, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (636, 'Concession autoroutière', '', 299, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (641, 'Conditions de détention', '', 2395, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (644, 'Conférence de la famille', 'Depuis 1996, la Conférence de la famille réunit tous les ans, sous la présidence du Premier ministre, les associations familiales, les partenaires sociaux, les organismes de protection sociale, des élus locaux et plusieurs ministres. Elle permet de présenter les grandes orientations et l''état d''avancement de la politique familiale. ', 2309, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (664, 'Conjoint collaborateur', 'Personne qui participe à l''activité professionnelle non salariée de son conjoint. En droit de la sécurité sociale, il relève à titre obligatoire du régime social des indépendants (L 741-6 CSS) Au plan commercial, le conjoint de l''entrepreneur individuel peut opter entre 3 statuts distincts : collaborateur, salarié ou associé.', 2609, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (710, 'Contrat de responsabilité parentale', 'Proposé par le président du Conseil général, le contrat de responsabilité parentale doit aider les parents à exercer pleinement leur autorité parentale lorsqu''ils sont confrontés à l''absentéisme scolaire de leur enfant ou à une grave difficulté éducative.', 298, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (717, 'Contrat de travail intermittent', '', 3001, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (718, 'Contrat de travail international', '', 3001, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (724, 'Contrat local de sécurité', '', 2318, null, '[]', 'CLSPD (Contrat local de sécurité et de prévention de la délinquance)');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (725, 'Contrat nouvelles embauches', 'Créé par l''ordonnance 2005-893 du 1er août 2005, le contrat nouvelles embauches permet aux entreprises qui emploient au plus 10 salariés de conclure ce contrat sans détermination de durée qui peut être rompu à tout moment pendant une période de 1 an.', 3001, null, '[]', 'CNE');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (726, 'Contrat pluriannuel d''objectifs et de moyens', 'Le contrat pluriannuel d''objectifs et de moyens (CPOM) est, en droit français, le contrat par lequel un organisme gestionnaire d''établissements ou services sociaux ou médico-sociaux s''engage auprès d''une autorité de tarification sur une période pluriannuelle pour, en fonction des objectifs d''activité poursuivis par ses établissements, bénéficier d''allocations budgétaires correspondantes. Le régime juridique du CPOM est défini à l''article L. 313-11 du Code de l''action sociale et des familles (CASF).', 696, null, '[]', 'CPOM');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (797, 'Couverture maladie universelle (CMU)', 'La couverture maladie universelle de base permet l''accès à l''assurance maladie pour toutes les personnes résidant en France de manière stable et régulière depuis plus de trois mois, et qui n''ont pas droit à l''assurance maladie à un autre titre (activité professionnelle, etc.).', 267, null, '[]', 'Assurance maladie universelle/Couverture maladie universelle');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (839, 'Débat politique', '', 3049, null, '[]', '');
