INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (867, 'Défenseur des droits', 'La loi constitutionnelle 2008-714 du 13 juillet 2008 (art. 41) crée le Défenseur des droits qui remplace le Médiateur de la République.', 2550, null, '[]', '');
