INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (1829, 'Maison départementale des personnes handicapées (MDPH)', 'Créées par la loi 2005-101 du 11 février 2005, les maisons départementales des personnes handicapées exercent une mission d''accueil, d''information, d''accompagnement et de conseil des personnes handicapées.', 2378, null, '[]', 'Maison du handicap/MDPH');
