INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (1896, 'Médecine générale', 'Branche de la médecine prenant en charge le suivi durable et les soins médicaux généraux d''une communauté, sans se limiter à des groupes de maladies relevant d''un organe, d''un âge, ou d''un sexe particulier. Le médecin généraliste est donc le spécialiste de la santé assurant le suivi, la prévention, les soins et le traitement des malades de sa collectivité, dans une vision à long terme de la santé et du bien-être de ceux qui le consultent.', 2779, null, '[]', '');
