INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2081, 'Ordre public social', 'Caractère s''attachant à la plupart des règles légales ou réglementaires de droit du travail et en vertu duquel les stipulations conventionnelles ou contractuelles qui seraient contraires aux règles étatiques (dans un sens défavorable aux salariés), sont privées d''effet. C''est un ordre public de protection, car il fixe des seuils qui garantissent un minimum de protection juridique et sociale. ', 2393, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2128, 'PACS', '', 2749, null, '[]', 'Contrat d''union civil et social/CUCS/Pacte civil de solidarité/Union sociale');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2129, 'Pacte de stabilité et de croissance', 'Le PSC est l''instrument dont les pays de la zone euro se sont dotés afin de coordonner leurs politiques budgétaires nationales et d''éviter l''apparition de déficits budgétaires excessifs. Il impose aux États de la zone euro d''avoir à terme des budgets proches de l''équilibre ou excédentaires.', 2320, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2149, 'Parcours de santé', 'Le parcours de santé se définit comme une prise en charge globale du patient et de l''usager dans un territoire donné. Il s''articule autour de la prévention, du sanitaire, du médico-social et du social. Les parcours reposent sur l''intervention d''acteurs du système de soins, de services et d''établissements médico-sociaux et sociaux, de collectivités locales, d''autres services de l''Etat et d''organismes de protection sociale.', 267, null, '[]', 'Parcours de soins');
