INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2352, 'Portage salarial', 'Le portage salarial repose sur une relation tripartite : un employeur (la société de portage), un salarié (le porté) et un client. Cette pratique consiste, pour une personne morale, à permettre à des personnes d''exercer une activité autonome, sous statut salarié, pour des clients sans s''immatriculer en qualité de travailleur indépendant.', 1964, null, '[]', 'Portage de salariés');
