INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2433, 'Programme interdépartemental d''accompagnement des handicaps et de la perte d''autonomie', 'Instauré par l''article 58 de la loi du 11 février 2005 pour l''égalité des droits et des chances et la citoyenneté des personnes handicapées, le programme interdépartemental d''accompagnement des handicaps et de la perte d''autonomie (PRIAC) est un outil de programmation de l''adaptation et de l''évolution de l''offre d''accompagnement collectif médico-social.', 2378, null, '[]', 'PRIAC');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2504, 'REACH', 'Réglementation chimique européenne qui a pour objectif d''offrir au public une meilleure protection vis-à-vis des substances chimiques intentionnellement produites. Reach est entrée en vigueur le 1er juin 2007. Les industries chimiques devront fournir les données de sûreté sanitaire et environnementale sur toutes les substances qu''elles produisent.', 2384, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2524, 'Réduction d''impôt pour investissement locatif (dispositifs Duflot/Pinel)', 'Loi n° 2014-366 du 24 mars 2014 pour l''accès au logement et un urbanisme rénové (Loi dite "Loi ALUR" ou "Loi Duflot"); l''article 5 de la loi de finances pour 2015 a introduit un nouveau dispositif d''investissement locatif intermédiaire dit Pinel. Il remplace le dispositif Duflot, dont il reprend les principales modalités, avec quelques assouplissements,', 2319, null, '[]', 'Loi dite Loi ALUR ou loi Duflot');
