INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2615, 'Revenu de solidarité active (RSA)', 'Le revenu de solidarité active (décret du 5 octobre 2007) permet aux bénéficiaires de l''allocation de parent isolé (API) et du revenu minimum d''insertion (RMI) qui reprennent un emploi de bénéficier d''un revenu garanti tenant compte à la fois des revenus d''activité professionnelle et des charges de famille.', 2380, null, '[]', 'RSA');
