INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2723, 'Service d''intérêt économique général', 'L''expression "service d''intérêt économique général" se réfère aux services de nature économique que les États membres ou la Communauté soumettent à des obligations spécifiques de service public en vertu d''un critère d''intérêt général. Cette notion couvre donc plus particulièrement certains services fournis par les grandes industries de réseau comme le transport, les services postaux, l''énergie et les communications.', 2724, null, '[]', 'SIEG');
