INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2874, 'Téléassistance', 'La téléassistance est l''action ou le service qui permet d''aider à distance. Les services de téléassistance en France ont été originalement utilisés pour pallier l''isolement des personnes âgées.', 2880, null, '[]', '');
INSERT INTO tags (id, label, description, parent_id, creation_date, links, usage) VALUES (2911, 'Titre emploi service entreprise (TESE)', 'Institué par la loi de modernisation de l''économie du 4 août 2008, le Titre emploi-service entreprise opérationnel à compter du 1er avril 2009 pour les entreprises de 9 salariés au plus, est destiné à simplifier les formalités liées à l''emploi et à remplacer le Chèque emploi TPE et le Titre emploi entreprise.', 1987, null, '[]', 'TESE');
